import React from 'react';
import './App.css';
import italy from './italy.jpeg';
import Destination from './Destination/Destination';
import Travel from './Travel/Travel';
import switzerland from './switzerland.jpeg';
import arctic from './arctic.jpeg';

function App() {
  return (
    <div className="App">
      <link href="https://fonts.googleapis.com/css2?family=Poppins:wght@700&display=swap" rel="stylesheet"></link>

      <div className="main-container">
        <img src={italy} className="italy-image" alt="Lake in Italy"/>
        <p className="TooTravel">
          TooTravel
        </p>
        <p className="main-text">
          The most beautiful places in the world!
        </p>
        <p className="supplementary-text">
          Plan your vacation to the most beautiful places in the world
        </p>
        <button>Get Started</button>
      </div>

      <header className="App-header">

        <span>Destinations</span>
        {/* <div className="image-container">
          <div className="nested-image-container">
            <Destination className="switzerland" img={switzerland}/>
            <Destination className="arctic" img ={arctic} />
          </div>
        </div> */}

        <Travel />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
        </a>
      </header>

    </div>
  );
}

export default App;
